problem.statement:
Let  \[f(x) =
\begin{cases}
k(x) &\text{if }x>3, \\
x^2-6x+12&\text{if }x\leq3.
\end{cases}
\] Find the function $k(x)$ such that $f$ is its own inverse.

Let $a,$ $b,$ $c,$ $d,$ and $e$ be the distinct roots of the equation $x^5 + 7x^4 - 2 = 0.$  Find
\begin{align*}
&\frac{a^5}{(a - b)(a - c)(a - d)(a - e)} + \frac{b^5}{(b - a)(b - c)(b - d)(b - e)} \\
&\quad + \frac{c^5}{(c - a)(c - b)(c - d)(c - e)} + \frac{d^5}{(d - a)(d - b)(d - c)(d - e)} \\
&\quad + \frac{e^5}{(e - a)(e - b)(e - c)(e - d)}.
\end{align*}

If $a,b,c$ are positive integers less than $13$ such that \begin{align*}
2ab+bc+ca&\equiv 0\pmod{13}\\
ab+2bc+ca&\equiv 6abc\pmod{13}\\
ab+bc+2ca&\equiv 8abc\pmod {13}
\end{align*}then determine the remainder when $a+b+c$ is divided by $13$.
